exports=async function(url,bid,cid,options){const{send}=require("http"),clientOptions={...(options&&options.clientOptions)};let response=await send(url,clientOptions);assertOK(response);let html=response.body;const images=JSON.parse(html.subRegex(/images:\s*\$\.parseJSON\('([^']+)'\)/).replace(/\\/g,"")),urls=images.map(_=>"https://img.wubizigeng.com"+_);return {urls}};